import React from 'react'

const UploadCsv = () => {
  const filech =async (e)=>{
    const files = e.target.files;
    const formData= new FormData();
    formData.append('img',files[0]); 
    fetch('/uploadcsv',{
      method:"POST",
      headers:{
        "Content-Type":"application/json"
      },
      body:JSON.stringify({
        formData:formData
      })
    })
  }
  return (
    <div>
      <h1>csv</h1>

      form
      <input type="file" onChange={filech}  name="img"/>
    </div>
  )
}

export default UploadCsv
